import { ICoverNote } from './definitions/ICoverNote';
import { INote } from './definitions/INote'; 
import { INotebook } from './definitions/INotebook';

class Notebook implements INotebook {
  coverNote: ICoverNote;
  notes: INote[];

  constructor() {
    this.coverNote = {
      author: 'john doe',
      data: 'pyrotechnics',
      date: '1900-00-00T00:00:00',
    }

    this.notes = [];
  }

  setCoverNote (coverNote: ICoverNote): void {
    this.coverNote = {
      ...coverNote,
    };
  }

  getCoverNote(): ICoverNote {
    return this.coverNote;
  }

  addNote (note: INote): void {
    this.notes.push(note);
  }

  getAllNotes (): INote[] {
    return this.notes;
  }
}

export default Notebook;

